import React from "react";
import { Link } from "react-router-dom";
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Flex,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

import DarkMode from "./DarkMode";
import { MoreHorizontal } from "react-feather";

const Navbar = () => (
  <Container
    isFluid
    paddingX={{ default: "major-8", "max-tablet": "major-3" }}
    paddingY="major-4"
    display="block"
    position="absolute"
    zIndex="10"
  >
    <Columns>
      <Columns.Column spread={3} spreadTablet={6} spreadMobile={6}>
        <Link to="/">
          <Heading use="h4">DAVI</Heading>
        </Link>
      </Columns.Column>

      <Columns.Column
        spread={2}
        spreadMobile={3}
        spreadTablet={6}
        textAlign={{ default: "center", "max-tablet": "end" }}
      >
        <DarkMode />
      </Columns.Column>

      <Columns.Column
        spread={1}
        spreadMobile={3}
        textAlign={{ default: "center", "max-tablet": "end" }}
      >
        <button>
          <MoreHorizontal />
        </button>
      </Columns.Column>
    </Columns>
  </Container>
);

export default Navbar;
